<!DOCTYPE html>
<html lang="ja">
<head>
  <meta charset="UTF-8" />
  <style>
    * { box-sizing: border-box; }

    body {
      background: radial-gradient(ellipse at center, #000010, #000000);
      margin: 0;
      padding: 0;
      font-family: 'Orbitron', 'Arial', sans-serif;
      color: #fff;
    }

    .container {
      border: 2px solid #00f0ff;
      padding: 10px 20px 15px 20px;
      width: calc(100% - 40px);
      max-width: 420px;
      margin: 40px auto;
      background: linear-gradient(180deg, rgba(0,255,255,0.05), rgba(255,0,255,0.05));
      border-radius: 12px;
      box-shadow: 0 0 25px rgba(0, 255, 255, 0.4), 0 0 40px rgba(255, 0, 255, 0.2);
      backdrop-filter: blur(4px);
    }

    .title {
      text-align: center;
      color: #00f0ff;
      font-weight: bold;
      font-size: 16px;
      margin-bottom: 10px;
      margin-top: 4px;
      text-shadow: 0 0 6px #00f0ff, 0 0 10px #ff00ff;
    }

    .tabs {
      display: flex;
      justify-content: space-between;
      margin-bottom: 14px;
    }

    .tab {
      flex: 1;
      margin: 0 4px;
      text-align: center;
      padding: 10px;
      cursor: pointer;
      border: 2px solid #00f0ff;
      color: white;
      background: rgba(0, 0, 0, 0.3);
      border-radius: 8px;
      box-shadow: 0 0 8px rgba(0, 255, 255, 0.3);
      transition: all 0.2s ease;
      font-weight: bold;
      text-shadow: 0 0 6px #00f0ff, 0 0 4px #fff;
    }

    .tab.active {
      background-color: rgba(0, 255, 255, 0.2);
      box-shadow: 0 0 15px #00f0ff;
    }

    .btn {
      display: block;
      width: 100%;
      margin: 10px 0;
      padding: 14px;
      background: rgba(255, 0, 255, 0.15);
      color: #ffffff;
      border: 2px solid #ff00ff;
      border-radius: 10px;
      font-size: 18px;
      text-align: center;
      text-shadow: 0 0 6px #ff00ff, 0 0 10px #fff;
      box-shadow: 0 0 15px #ff00ff, 0 0 8px rgba(255, 0, 255, 0.3);
      transition: transform 0.15s ease-in-out;
      cursor: pointer;
    }

    .btn:hover {
      transform: scale(1.05);
      box-shadow: 0 0 18px #ff00ff, 0 0 20px #00f0ff;
    }

    .tab-content { display: none; }
    .tab-content.active { display: block; }

    @import url('https://fonts.googleapis.com/css2?family=Orbitron:wght@500&display=swap');
  </style>
